import React from 'react';


export default function Table ({ data }) {
  const columns = [
    { title: 'in_frame', field: 'in_frame' },
    { title: 'out_frame', field: 'out_frame' },
    { title: 'value', filed: 'value' },
    { title: 'labels', field: 'labels' },
    { title: 'location', field: 'location' },
  ];

  return (
    <table>
      <caption>Graphics Markup Data</caption>
      <thead>
        <tr>
          {columns.map(({ title }) => <th>{title}</th>)}
        </tr>
      </thead>
      <tbody>
        {data && data.map(({
          in_frame,
          out_frame,
          content,
        }) => (
          <tr>
            <td>{in_frame}</td>
            <td>{out_frame}</td>
            <td>
              <ul>
                {content.value.map((value) => (
                  <li>{value}</li>
                ))}
              </ul>
            </td>
            <td>
              <ul>
                {content.labels.map((label) => (
                  <li>{label}</li>
                ))}
              </ul>
            </td>
            <td>
              <ul>
                {content.loacation.map((location) => (
                  <li>{location}</li>
                ))}
              </ul>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
